import React, { Component } from "react";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";

class SignUp2 extends Component {
  state = {
    name: null,
    email: null,
    password: null,
    username: null
  };

  onChangeName = e => {};
  onChangeEmail = e => {};
  onChangePass = e => {};
  onChangeUser = e => {};


  render() {
    return (
      <div>
        <div>
          <TextField
            id="outlined-name"
            label="Name"
            margin="normal"
            variant="outlined"
          />
        </div>

        <div>
          <TextField
            id="outlined-name"
            label="Username"
            margin="normal"
            variant="outlined"
          />
        </div>
        <div>
          <TextField
            id="outlined-name"
            label="Email"
            margin="normal"
            variant="outlined"
          />
        </div>
        <div>
          <TextField
            id="outlined-name"
            label="Password"
            margin="normal"
            variant="outlined"
          />
        </div>

        <div>
          <Button variant="contained" color="secondary">
            SignUp
          </Button>
        </div>
      </div>
    );
  }
}
export default SignUp2;
